import React, { useState } from "react";
import { Link } from "react-router-dom";

function Login() {
  const [showPassword, setShowPassword] = useState(false);

  const togglePassword = () => setShowPassword((prev) => !prev);

  const handleSubmit = (e) => {
    e.preventDefault();
    // handle login logic
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "#f9f9f9",
        padding: "1rem"
      }}
    >
      <div
        style={{
          background: "#fff",
          padding: "30px",
          width: "100%",
          maxWidth: "400px",
          border: "1px solid #ddd",
          borderRadius: "8px"
        }}
      >
        <div style={{ textAlign: "center", marginBottom: "20px" }}>
          <img src="/media/images/logo.svg" alt="Logo" style={{ height: "22px" }} />
          <h2 style={{ marginTop: "20px", fontSize: "24px" }}>Log in</h2>
        </div>

        {/* Login with Google and Facebook */}
        <div style={{ display: "flex", gap: "10px", marginBottom: "20px" }}>
          <button
            style={{
              flex: 1,
              border: "1px solid #ccc",
              padding: "8px",
              background: "#fff",
              cursor: "pointer"
            }}
          >
            <img
              src="https://img.icons8.com/color/16/google-logo.png"
              alt="google"
              style={{ marginRight: "6px" }}
            />
            Google
          </button>
          <button
            style={{
              flex: 1,
              border: "1px solid #ccc",
              padding: "8px",
              background: "#fff",
              cursor: "pointer"
            }}
          >
            <img
              src="https://img.icons8.com/fluency/16/facebook-new.png"
              alt="facebook"
              style={{ marginRight: "6px" }}
            />
            Facebook
          </button>
        </div>

        <div style={{ textAlign: "center", color: "#888", marginBottom: "15px" }}>
          <span>or</span>
        </div>

        {/* Login Form */}
        <form onSubmit={handleSubmit}>
          <div style={{ marginBottom: "15px" }}>
            <label htmlFor="email" style={{ fontWeight: "500", display: "block", marginBottom: "5px" }}>
              Email
            </label>
            <input
              type="email"
              id="email"
              placeholder="Enter email"
              required
              style={{
                width: "100%",
                padding: "8px",
                borderRadius: "4px",
                border: "1px solid #ccc"
              }}
            />
          </div>

          <div style={{ marginBottom: "15px", position: "relative" }}>
            <label htmlFor="password" style={{ fontWeight: "500", display: "block", marginBottom: "5px" }}>
              Password
            </label>
            <input
              type={showPassword ? "text" : "password"}
              id="password"
              placeholder="Enter password"
              required
              style={{
                width: "100%",
                padding: "8px",
                paddingRight: "40px",
                borderRadius: "4px",
                border: "1px solid #ccc"
              }}
            />
            <span
              onClick={togglePassword}
              style={{
                position: "absolute",
                top: "35px",
                right: "10px",
                cursor: "pointer",
                fontSize: "14px",
                color: "#555"
              }}
            >
              {showPassword ? "üôà" : "üëÅÔ∏è"}
            </span>
            <div style={{ textAlign: "right", marginTop: "6px" }}>
              <Link to="/forgot-password" style={{ fontSize: "14px", color: "#007bff", textDecoration: "none" }}>
                Forgot password?
              </Link>
            </div>
          </div>

          <button
            type="submit"
            style={{
              width: "100%",
              padding: "10px",
              backgroundColor: "#111",
              color: "#fff",
              fontWeight: "bold",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer"
            }}
          >
            Log in
          </button>
        </form>

        <p style={{ textAlign: "center", marginTop: "20px", fontSize: "14px" }}>
          Don‚Äôt have an account?{" "}
          <Link to="/signup" style={{ color: "#007bff", textDecoration: "none" }}>
            Sign Up
          </Link>
        </p>
      </div>
    </div>
  );
}

export default Login;
